import React, { Fragment } from 'react';
import { NavLink } from 'react-router-dom';

const purple = (props) => (
    <Fragment>
        <h1>Purple</h1>
        <NavLink to="/">Return to Main</NavLink>
    </Fragment>
);

export default purple;
